def get_ports_n_protocols(machine):
    thresh = 2
    tmp = {}
    for f in machine:
        if f.startswith('p') and f != 'protocols' and f != 'ports':
            prot = f.split('_')[1]
            if prot in tmp:
                tmp[prot] += [int(f.split('_')[0][1:])]
            else:
                tmp[prot] = [int(f.split('_')[0][1:])]

    m_ports_raw = {t: dict(Counter(tmp[t])) for t in tmp}
    machine_protocols = {}
    for _prot in m_ports_raw:
        res = []
        for k in m_ports_raw[_prot]:
            if m_ports_raw[_prot][k] >= thresh:
                res.append(k)
        machine_protocols[_prot] = res

    return machine_protocols


def num_ports_running(pnps):
    return [
        Feature(as_obj={
            '_id': 'NUM_PORTS',
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': sum([len(pnps[i]) for i in pnps]),
            'description': 'Number of ports '
                           'that are open for a machine.'
        }),
    ]


def operating_system(machine, args):
    res = []
    res += enumerated_field(machine,
                            field='metadata_description',
                            enum_list=const.operating_systems,
                            add_fields=['metadata_manufacturer',
                                        'metadata_os',
                                        'metadata_os_description',
                                        'metadata_product'])
    return res


def running_services(pnps):
    res = []
    for _protocol in const.ports_and_protocols:
        for _port in _protocol[1]:
            res += [
                Feature(as_obj={
                    '_id': 'RUNNING_P{}_{}'.format(_port, _protocol[0].upper()),
                    '_type': 'MACHINE',
                    'expansion_safe': True,
                    'value': 1 if (_protocol[0] in pnps)
                             and (_port in pnps[_protocol[0]]) else 0,
                    'description': 'Is this machine '
                                   'running {}?'.format(_protocol[0])
                })
            ]
    return res


def asn_features(machine, args):
    res = []
    enum_list = common_asns
    add_fields = ['autonomous_system_description',
                  'autonomous_system_organization']

    res += enumerated_field(machine,
                            field='autonomous_system_name',
                            enum_list=enum_list,
                            add_fields=add_fields)

    self_asn = enumerated_field(machine,
                                field='autonomous_system_name',
                                enum_list=[args['c_id'], args['domain']],
                                add_fields=add_fields)
    res += [
        Feature(as_obj={
            '_id': 'COMPANY_NAME_IN_ASN',
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': len([s for s in self_asn if s.get_value()]) > 0,
            'description': 'is the company name in the ASN field? '
                           'most likely on prem then'
        })
    ]

    return res


