def risk_of_services(pnps):
    res = []
    risk_map = {_p[0]: _p[2]
                for _p in const.ports_and_protocols}
    risks = [risk_map[service]
             for service in pnps
             for _ in pnps[service]]

    for risk in set(risk_map.values()):
        res += [
            Feature(as_obj={
                '_id': 'NUM_{}_RISK_SERVICES_RUNNING'.format(risk.upper()),
                '_type': 'MACHINE',
                'descriptive': True,
                'expansion_safe': True,
                'value': len([r for r in risks if r == risk]),
                'description': 'how many {} risk '
                               'services is this '
                               'machine running?'.format(risk)
            })
        ]
    return res


def desc_features(m, args):
    res = [
        Feature(as_obj={
            '_id': 'CENSYS_DATE_TABLE',
            '_type': 'MACHINE',
            'expansion_safe': False,
            'value': args['date'],
            'descriptive': True,
            'description': 'the date we collected this data point. aka the censys table'
        }),
        Feature(as_obj={
            '_id': 'IP_ADDRESS',
            '_type': 'MACHINE',
            'expansion_safe': False,
            'value': m['ip'],
            'descriptive': True,
            'description': 'Ip address of the machine'
        }),
        Feature(as_obj={
            '_id': 'SPLIT_MATCHES',
            '_type': 'MACHINE',
            'expansion_safe': False,
            'descriptive': True,
            'value': m['SPLIT_MATCHES'],
            'description': 'what were the criterion for this point being selected from censys'
        }),
        Feature(as_obj={
            '_id': 'DOMAIN',
            '_type': 'MACHINE',
            'descriptive': True,
            'expansion_safe': False,
            'value': args['domain'],
            'description': 'the domain this machine is associated with'
        })
    ]
    return res


def get_protocol_feature_modules():
    res = []
    for name, feature_module in getmembers(protocol_features):
        if isinstance(feature_module, types.ModuleType) and 'features' in name and 'u_' not in name:
            res += [(name, feature_module)]
    return res


