def extract(raw_m, args, value_mapped=False, mini=False):
    # possibles
    # alexa rank
    # tls validation stores

    machine = utils.recurse_machine_fields(raw_m)
    ports_n_protocols = get_ports_n_protocols(machine)

    features = []
    features += num_ports_running(ports_n_protocols)
    features += running_services(ports_n_protocols)
    features += asn_features(machine, args=args)
    features += operating_system(machine, args=args)

    features += risk_of_services(ports_n_protocols)
    features += desc_features(m=machine, args=args)

    for name, feature_module in get_protocol_feature_modules():
        # print "[x] Extracting {} ".format(name)
        features += feature_module.extract(machine, args=args)

    if value_mapped:
        return value_map(features, mini)
    else:
        return features


